                <th style={{ backgroundColor: "#abebc6", padding: "15px" }}>PAN Number</th>
                <th style={{ backgroundColor: "#abebc6", padding: "15px" }}>	Tax Status</th>
                <th style={{ backgroundColor: "#abebc6", padding: "15px" }}>DOB</th>
