                <td>A211</td>
                <td> AMIT SHARDA</td>
                <td>amitams@yahoo.com</td>
                <td>9902526376</td>
                <td>	AOVPS6703D</td>
                <td>Individual</td>
                <td>01/01/1980</td>
              </tr>
            </tbody>
          </Table>

          <Form.Group as={Col} controlId="formGridZip">
            <Button variant="primary" type="submit" style={{ margin: '10px', width: '150px' }}>
              Mark Inactive
            </Button>
          </Form.Group>
        </Grid>
      </SuiBox>

      {/* <DataTable table={dataTableData} canSearch /> */}
      <Footer />
    </DashboardLayout>
  );
}

export default EditProduct;
